import React from 'react';

import ButtonSmall from '../../UserInterface/Buttons/Button/ButtonSmall';
import ButtonLinkNotMouse from '../../UserInterface/Buttons/Button/ButtonLinkNotMouse';

function WarningValueNotSelected(props) {

    const hendlerButtonHelp = () => {
        let helper = document.getElementById('helpWarningValueNotSelected');
        helper.innerHTML = `Вернитесь в таблицу, 
                            выберите значение, 
                            кликните по строке левой кнопкой мыши. 
                            Значение выбрано.
                            В консоли управления таблицей выберите действие.
`
    }

    return (
        
        <div className="">
            <h1>
                !!! ВНИМАНИЕ !!!
             </h1>

            <div id="helpWarningValueNotSelected">
               Действие не может быть призведено. Выберите значение.
             </div>

            <ButtonLinkNotMouse
                classname={props.classnameButtonWarning}
                onclick={props.onclickWarning}
                name='Назад'
                to={props.to}
            />
            <ButtonSmall
                classname={props.classnameButtonWarningHelp}
                icon="fa fa-question"
                onclick={hendlerButtonHelp}
            />

        </div>
      
    )
}

export default WarningValueNotSelected
